%[text] # **What is a Chart?**
%[text] This script aims to provide some background context and motivation for creating and using charts. A chart is a MATLAB class that encapsulates a visualization workflow, providing end users with a convenient API whilst hiding unnecessary implementation details. In the example that follows, we'll introduce the key concepts using a 2D scatter plot together with the corresponding best-fit line.
%[text] MATLAB graphics comprise low-level objects, such as lines, lights, and patches, as well as higher-level objects such as histograms and violin plots. These graphics objects can used in combination to build up more sophisticated visualizations. As the complexity and size of the visualizations grow, it becomes more challenging to maintain and extend the code using a script or function-based approach. A chart provides a pattern for designing a reusable visualization with all the benefits associated with using object-oriented programming: encapsulation, maintainability, separation of concerns, extensibility, and usability.
%[text] A chart is a composition of graphics objects designed for a specific workflow. Typically, a chart will manage one or more axes objects, together with axes children such as line or scatter objects, and may provide interactive controls for customizing the chart's appearance or configuration.
%[text] Charts may be used in casual scripting workflows, or with more advanced procedural or object-oriented programming. Charts can be integrated in apps using App Designer, or when [building apps programmatically](<matlab: web("https://www.mathworks.com/company/technical-articles/developing-matlab-apps-using-the-model-view-controller-pattern.html")>). In the model-view-controller (MVC) software architecture pattern, charts are used to help construct views and controllers, and are reusable between different applications.
%[text] The concept of a [custom user-interface component](<matlab: web("https://www.mathworks.com/help/matlab/developing-custom-ui-component-classes.html")>) is similar to the chart design pattern. The main difference is that charts usually contain one or more axes together with their children, whereas custom components are usually built from control objects such as buttons, dropdown menus, check boxes, and so on.
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] 
%%
%[text] ## Introduction.
%[text] In this example, we'll create 2D scattered data and plot the best-fit line. We assume that we're in a situation where the data updates frequently. For example, we might be building a web dashboard that monitors a live data stream and updates periodically.
%[text] Create sample $(x, y)$ data. The $x$-data is evenly spaced between 0 and 1, and the $y$-data is a linear function of $x$ with some added random noise.
rng( "default" )
x = linspace( 0, 1, 1000 ).';
y = 2 * x + 1 + 0.25 * randn( size( x ) );
%%
%[text] ## Create a scatter plot of the data.
%[text] We use the [`scatter`](<matlab: doc("scatter")>) function to create a discrete plot.
figure %[output:0936209e]
s = scatter( x, y, "filled" ); %[output:0936209e]
%%
%[text] ## Compute and add the best-fit line.
%[text] We use [`fitlm`](<matlab: doc("fitlm")>) to fit a linear model to the $(x, y)$ data. The default model assumes that $y$ is a linear function of $x$ subject to some random measurement error.
model = fitlm( x, y );
%[text] Overlay the model fit on the scatter plot.
hold on %[output:1c74ad09]
p = plot( x, model.Fitted, "LineWidth", 3 ); %[output:1c74ad09]
%%
%[text] ## Suppose that our x-data changes.
%[text] Now suppose that we receive updated $x$-data in our application. It's easy to update the `scatter` object in our visualization by setting its `XData` property.
s.XData = s.XData + 2; %[output:9b9abfcc]
%[text] As we expect, this updates the scatter plot, but not the best-fit line associated with the $(x, y)$-data.
%[text] This demonstrates an important issue: the scatter plot and the best-fit line are not synchronized.
%%
%[text] ## Suppose that our x-data now has a different size.
%[text] Next, we assume that we receive new $x$-data with a different size to the data that we have already. For example, the new $x$-data could have length 500, compared to our original data length of 1000.
xnew = x(1:500);
s.XData = xnew; %[output:33f57a5f]
%[text] Attempting to update the scatter plot causes a warning to be issued, since the `XData` and `YData` properties of the scatter plot now have different lengths. 
%[text] The scatter plot is no longer rendered. This illustrates another issue: when updating the scatter plot, both the $x$-data and the $y$-data must have the same length. 
%[text] Changing the $x$-data or $y$-data individually may cause the scatter plot to disappear.
%%
%[text] ## Now update the y-data.
%[text] Suppose that we now receive new $y$-data, and we attempt to update the scatter plot. This update will render the scatter object as long as the new y-data has the same length as the new x-data.
s.YData = - 2 * xnew + 0.5 + randn( size( xnew ) ); %[output:4abe1381]
%[text] However, the best-fit line is still incorrect and must be refreshed.
%%
%[text] ## Refresh the best-fit line.
model = fitlm( s.XData, s.YData );
set( p, "XData", s.XData, "YData", model.Fitted ) %[output:7b53f7fa]
%%
%[text] ## Summary.
%[text] We've seen that even for a simple visualization example, there are challenges associated with managing data updates:
%[text] - the graphics objects representing the scatter plot and best-fit line are not automatically synchronized,
%[text] - updating the scatter plot $x$-data or $y$-data individually may cause the scatter plot to disappear. \
%[text] Designing a chart class provides a robust way to resolve these issues. For further details, see the [technical article](<matlab: web("https://www.mathworks.com/company/technical-articles/creating-specialized-charts-with-matlab-object-oriented-programming.html")>) and development guide available in this toolbox.

